import React from 'react';
import Head from 'next/head';

const App = ({ Component }) => {
  return (
    <>
      <Head>
        <meta charSet="utf-8" />
        <title>Bluejay</title>
      </Head>
      <Component />
    </>
  );
};

export default App;
